#include "vislib/D3DVISLogo.h"

#include "vislib/d3dverify.h"
#include "vislib/IllegalStateException.h"


/*
 * vislib::graphics::d3d::D3DVISLogo::D3DVISLogo
 */
vislib::graphics::d3d::D3DVISLogo::D3DVISLogo(IDirect3DDevice9 *device)
        : apiVersion(D3DVERSION_9), device9(device), vb9(NULL) {
    ASSERT(this->device9 != NULL);
    this->device9->AddRef();
}


/*
 * vislib::graphics::d3d::D3DVISLogo::D3DVISLogo
 */
vislib::graphics::d3d::D3DVISLogo::D3DVISLogo(ID3D10Device *device)
        : apiVersion(D3DVERSION_10), device10(device), vb10(NULL) {
    ASSERT(this->device10 != NULL);
    this->device10->AddRef();
}


/*
 * vislib::graphics::d3d::D3DVISLogo::~D3DVISLogo
 */
vislib::graphics::d3d::D3DVISLogo::~D3DVISLogo(void) {
    this->Release();

    switch (this->apiVersion) {
        case D3DVERSION_9:
            SAFE_RELEASE(this->device9);
            break;

        case D3DVERSION_10:
            SAFE_RELEASE(this->device10);
            break;

        default:
            ASSERT(false);  // Should be unreachable.
            break;
    }
}


/*
 * vislib::graphics::d3d::D3DVISLogo::Create
 */
void vislib::graphics::d3d::D3DVISLogo::Create(void) {
    USES_D3D_VERIFY;
    static const UINT VB_SIZE = sizeof(VERTICES);
    Vertex *vertices = NULL;

    /* Reset possible old VIS logo. */
    this->Release();

    switch (this->apiVersion) {

        case D3DVERSION_9:
            D3D_VERIFY_THROW(this->device9->CreateVertexBuffer(VB_SIZE, 0, FVF,
                D3DPOOL_MANAGED, &this->vb9, NULL));
            D3D_VERIFY_THROW(this->vb9->Lock(0, VB_SIZE,
                reinterpret_cast<VOID **>(&vertices), 0));
            ::memcpy(vertices, VERTICES, VB_SIZE);
            D3D_VERIFY_THROW(this->vb9->Unlock());
            break;

        case D3DVERSION_10: {
            // TODO: untested
            D3D10_BUFFER_DESC bufDesc;
            bufDesc.Usage = D3D10_USAGE_DEFAULT;
            bufDesc.ByteWidth = VB_SIZE;
            bufDesc.BindFlags = D3D10_BIND_VERTEX_BUFFER;
            bufDesc.CPUAccessFlags = 0;
            bufDesc.MiscFlags = 0;

            D3D10_SUBRESOURCE_DATA initData;
            initData.pSysMem = VERTICES;
            initData.SysMemPitch = VB_SIZE;
            initData.SysMemSlicePitch = VB_SIZE;

            D3D_VERIFY_THROW(this->device10->CreateBuffer(&bufDesc, &initData,
                &this->vb10));
            } break;

        default:
            throw IllegalStateException("'apiVersion' must be one of "
                "D3DVERSION_9 or D3DVERSION_10", __FILE__, __LINE__);
            break;
    }

}


/*
 * vislib::graphics::d3d::D3DVISLogo::Draw
 */
void vislib::graphics::d3d::D3DVISLogo::Draw(void) {
    USES_D3D_VERIFY;
    static const UINT CNT_VERTICES = (sizeof(VERTICES) / VERTEX_SIZE) - 2;

    switch (this->apiVersion) {
        case D3DVERSION_9:
            D3D_VERIFY_THROW(this->device9->SetStreamSource(0, this->vb9, 0,
                VERTEX_SIZE));
            D3D_VERIFY_THROW(this->device9->SetFVF(FVF));
            D3D_VERIFY_THROW(this->device9->DrawPrimitive(D3DPT_TRIANGLESTRIP,
                0, CNT_VERTICES));
            break;

        case D3DVERSION_10:
            // TODO
            break;

        default:
            throw IllegalStateException("'apiVersion' must be one of "
                "D3DVERSION_9 or D3DVERSION_10", __FILE__, __LINE__);
            break;
    }
}


/*
 * vislib::graphics::d3d::D3DVISLogo::Release
 */
void vislib::graphics::d3d::D3DVISLogo::Release(void) {
    switch (this->apiVersion) {
        case D3DVERSION_9:
            SAFE_RELEASE(this->vb9);
            break;

        case D3DVERSION_10:
            SAFE_RELEASE(this->vb10);
            break;

        default:
            ASSERT(false);  // Should be unreachable.
            break;
    }
}


